import React from 'react';



const Fetchpokemon = function ({pokemon,url}){

	     var arr =[]
	     for (let i of pokemon){
            arr.push(<li key={pokemon.indexOf(i)}>{i}</li>)
	     }
	     return arr;
}


















export default Fetchpokemon;
